array = [eval(i) for i in array]
array = list(set(array))
array.sort()
print(array)

for i in range(len(array)-1):
    k_needed = array[i+1]-array[i]-1
    kneeded.append(k_needed)

max = -1
for i in range(len(array)-1):
    index = i
    kremaining = k
    size = 0
    while kremaining > 0 and index < len(array)-1:
        if kneeded[index] != 0:
            if kremaining < kneeded[index]:
                size = size + kremaining + 1
                break
            else:
                kremaining = kremaining - kneeded[index]
                size = size + kneeded[index]
        size = size + 1
        index = index + 1
    if size > max:
        max = size
print(max+1)


